import React from 'react';
import './css/Main.css';
import Puppy from '../static/images/profile.jpg';
import styled from 'styled-components';
import gsap from 'gsap/gsap-core';

const Img = styled.img`
  position: absolute;
  left: 0;
  height: 100%;
`;

gsap.to('#profile');

function Main() {
  return (
    <div id="mainPage">
      <div id="profile">
        <Img src={Puppy} alt="me"></Img>
      </div>
      <h1 id="mainTitle">hello</h1>
    </div>
  );
}

export default Main;
